import React from "react";
import { styled } from "styled-components";
import { ReactComponent as HeaderImg } from "../images/mypage.svg";
import { ReactComponent as ProfileImg } from "../images/profile.svg";
import { ReactComponent as NextImg } from "../images/nextbtn.svg";
import { ReactComponent as PrevImg } from "../images/prevbtn.svg";
import Footer from "../components/Footer";
import Slider from "react-slick";

export default function MatchingProfile() {
  const userData = [
    {
      name: "AlmondBriize",
      sex: "여성",
      age: 23,
      location: "합정역 2호선",
    },
  ];

  var settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
  };

  return (
    <div>
      <HeaderImg />
      <ProfileBox>
        <ProfileImg />
        <UserName>AlmondBriize(여성/23)</UserName>
        <UserLocation>합정역 2호선</UserLocation>
      </ProfileBox>
      <PostBox>
        <h2>작성한 글</h2>
        <Slider {...settings}>
          <div>1</div>
          <div>2</div>
          <div>3</div>
        </Slider>
      </PostBox>
      <ReviewBox></ReviewBox>
      <Footer />
    </div>
  );
}

const ProfileBox = styled.div`
  text-align: center;
  margin-top: 72px;
`;

const UserName = styled.div`
  color: var(--Black, #222);
  font-family: Pretendard;
  font-size: 36px;
  font-style: normal;
  font-weight: 600;
  line-height: 140%; /* 50.4px */
  letter-spacing: -1px;
`;

const UserLocation = styled.div`
  color: var(--Gray-02, #ccc);
  font-family: Pretendard;
  font-size: 20px;
  font-style: normal;
  font-weight: 600;
  line-height: 140%; /* 28px */
  letter-spacing: -1px;
`;

const PostBox = styled.div`
  display: flex;
  text-align: center;
  width: 426px;
  height: 406px;
  border: 10px solid rgba(black, 0.1);
  flex-shrink: 0;
  margin-left: 296px;
  margin-top: 187px;
  border-radius: 16px;
  background: var(--White, #fff);
  /* Shadow 01 */
  box-shadow: 0px 4px 20px 0px rgba(51, 51, 51, 0.1);
`;

const ReviewBox = styled.div``;
